import React from "react";
import { Button } from "react-bootstrap";
import { Form } from "react-bootstrap";

const LoginForm = () => {
  return (
    <Form>
      <Form.Group>
        <Form.Control
          type="text"
          placeholder="Username"
          name="username"
          required
        />
      </Form.Group>
      <Form.Group>
        <Form.Control
          type="password"
          placeholder="Password"
          name="password"
          required
        />
      </Form.Group>
      <Button variant="success" type="submit">
        Login
      </Button>
    </Form>
  );
};

export default LoginForm;
